import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { ExternalLink, Github, Eye, Code, TestTube, Database } from 'lucide-react';

const Projects: React.FC = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const [selectedCategory, setSelectedCategory] = useState('all');

  const categories = [
    { id: 'all', name: 'All Projects' },
    { id: 'automation', name: 'Test Automation' },
    { id: 'performance', name: 'Performance Testing' },
    { id: 'mobile', name: 'Mobile Testing' },
    { id: 'api', name: 'API Testing' }
  ];

  const projects = [
    {
      id: 1,
      title: "E-commerce Platform Test Automation",
      category: "automation",
      description: "Comprehensive test automation framework for a large-scale e-commerce platform with 95% test coverage.",
      image: "https://images.unsplash.com/photo-1556742049-0cfed4f6a45d?w=400&h=300&fit=crop",
      technologies: ["Selenium", "TestNG", "Java", "Jenkins", "Docker"],
      features: [
        "Cross-browser testing automation",
        "Parallel test execution",
        "CI/CD integration",
        "Comprehensive reporting",
        "Data-driven testing"
      ],
      liveUrl: "#",
      githubUrl: "#",
      demoUrl: "#"
    },
    {
      id: 2,
      title: "Mobile Banking App Testing",
      category: "mobile",
      description: "End-to-end testing solution for a mobile banking application ensuring security and reliability.",
      image: "https://images.unsplash.com/photo-1563013544-824ae1b704d3?w=400&h=300&fit=crop",
      technologies: ["Appium", "Java", "TestNG", "Android Studio", "Xcode"],
      features: [
        "iOS and Android testing",
        "Security testing automation",
        "Biometric authentication testing",
        "Performance monitoring",
        "Real device testing"
      ],
      liveUrl: "#",
      githubUrl: "#",
      demoUrl: "#"
    },
    {
      id: 3,
      title: "API Testing Framework",
      category: "api",
      description: "Robust API testing framework with comprehensive validation and performance testing capabilities.",
      image: "https://images.unsplash.com/photo-1555066931-4365d14bab8c?w=400&h=300&fit=crop",
      technologies: ["RestAssured", "Postman", "Java", "Newman", "Jenkins"],
      features: [
        "REST API testing",
        "GraphQL testing",
        "Schema validation",
        "Performance testing",
        "Security testing"
      ],
      liveUrl: "#",
      githubUrl: "#",
      demoUrl: "#"
    },
    {
      id: 4,
      title: "Performance Testing Suite",
      category: "performance",
      description: "Comprehensive performance testing solution for high-traffic web applications.",
      image: "https://images.unsplash.com/photo-1551288049-bebda4e38f71?w=400&h=300&fit=crop",
      technologies: ["JMeter", "Gatling", "Docker", "Grafana", "InfluxDB"],
      features: [
        "Load testing",
        "Stress testing",
        "Spike testing",
        "Real-time monitoring",
        "Performance reporting"
      ],
      liveUrl: "#",
      githubUrl: "#",
      demoUrl: "#"
    },
    {
      id: 5,
      title: "Healthcare Portal Testing",
      category: "automation",
      description: "Comprehensive testing solution for a healthcare management portal with HIPAA compliance.",
      image: "https://images.unsplash.com/photo-1576091160399-112ba8d25d1f?w=400&h=300&fit=crop",
      technologies: ["Cypress", "JavaScript", "Cucumber", "Jenkins", "Docker"],
      features: [
        "BDD testing approach",
        "Accessibility testing",
        "Compliance validation",
        "Data privacy testing",
        "Cross-platform testing"
      ],
      liveUrl: "#",
      githubUrl: "#",
      demoUrl: "#"
    },
    {
      id: 6,
      title: "IoT Device Testing Platform",
      category: "automation",
      description: "Innovative testing platform for IoT devices ensuring connectivity and functionality.",
      image: "https://images.unsplash.com/photo-1518709268805-4e9042af2176?w=400&h=300&fit=crop",
      technologies: ["Python", "Selenium", "MQTT", "Docker", "Grafana"],
      features: [
        "Device connectivity testing",
        "Protocol testing",
        "Real-time monitoring",
        "Automated reporting",
        "Scalable architecture"
      ],
      liveUrl: "#",
      githubUrl: "#",
      demoUrl: "#"
    }
  ];

  const filteredProjects = selectedCategory === 'all' 
    ? projects 
    : projects.filter(project => project.category === selectedCategory);

  const getCategoryIcon = (category: string) => {
    switch (category) {
      case 'automation': return <Code className="w-5 h-5" />;
      case 'performance': return <TestTube className="w-5 h-5" />;
      case 'mobile': return <Eye className="w-5 h-5" />;
      case 'api': return <Database className="w-5 h-5" />;
      default: return <Code className="w-5 h-5" />;
    }
  };

  return (
    <section id="projects" className="section-padding">
      <div className="container-custom">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-3xl md:text-4xl font-bold mb-4">
            Featured <span className="gradient-text">Projects</span>
          </h2>
          <p className="text-lg text-gray-600 dark:text-gray-300 max-w-3xl mx-auto">
            Showcase of comprehensive testing solutions and automation frameworks 
            developed for various industries and technologies.
          </p>
        </motion.div>

        {/* Category Filter */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.2 }}
          className="flex flex-wrap justify-center gap-4 mb-12"
        >
          {categories.map((category) => (
            <button
              key={category.id}
              onClick={() => setSelectedCategory(category.id)}
              className={`px-6 py-3 rounded-lg font-medium transition-all duration-300 ${
                selectedCategory === category.id
                  ? 'bg-primary-600 text-white shadow-lg'
                  : 'bg-gray-100 dark:bg-dark-700 text-gray-700 dark:text-gray-300 hover:bg-primary-100 dark:hover:bg-primary-900'
              }`}
            >
              {category.name}
            </button>
          ))}
        </motion.div>

        {/* Projects Grid */}
        <motion.div
          layout
          className="grid md:grid-cols-2 lg:grid-cols-3 gap-8"
        >
          {filteredProjects.map((project, index) => (
            <motion.div
              key={project.id}
              layout
              initial={{ opacity: 0, y: 30 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ duration: 0.8, delay: index * 0.1 }}
              className="group"
            >
              <div className="bg-white dark:bg-dark-800 rounded-lg overflow-hidden shadow-lg hover:shadow-xl transition-all duration-300 card-hover">
                {/* Project Image */}
                <div className="relative overflow-hidden h-48">
                  <img
                    src={project.image}
                    alt={project.title}
                    className="w-full h-full object-cover group-hover:scale-110 transition-transform duration-300"
                  />
                  <div className="absolute inset-0 bg-gradient-to-t from-black/60 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300">
                    <div className="absolute bottom-4 left-4 right-4 flex gap-2">
                      <motion.button
                        whileHover={{ scale: 1.1 }}
                        whileTap={{ scale: 0.9 }}
                        className="p-2 bg-white/20 backdrop-blur-sm rounded-lg text-white hover:bg-white/30 transition-colors duration-300"
                      >
                        <ExternalLink size={16} />
                      </motion.button>
                      <motion.button
                        whileHover={{ scale: 1.1 }}
                        whileTap={{ scale: 0.9 }}
                        className="p-2 bg-white/20 backdrop-blur-sm rounded-lg text-white hover:bg-white/30 transition-colors duration-300"
                      >
                        <Github size={16} />
                      </motion.button>
                      <motion.button
                        whileHover={{ scale: 1.1 }}
                        whileTap={{ scale: 0.9 }}
                        className="p-2 bg-white/20 backdrop-blur-sm rounded-lg text-white hover:bg-white/30 transition-colors duration-300"
                      >
                        <Eye size={16} />
                      </motion.button>
                    </div>
                  </div>
                </div>

                {/* Project Content */}
                <div className="p-6">
                  <div className="flex items-center gap-2 mb-3">
                    {getCategoryIcon(project.category)}
                    <span className="text-sm text-primary-600 dark:text-primary-400 font-medium">
                      {categories.find(cat => cat.id === project.category)?.name}
                    </span>
                  </div>
                  
                  <h3 className="text-xl font-bold text-gray-900 dark:text-white mb-3">
                    {project.title}
                  </h3>
                  
                  <p className="text-gray-600 dark:text-gray-300 mb-4">
                    {project.description}
                  </p>

                  {/* Technologies */}
                  <div className="mb-4">
                    <div className="flex flex-wrap gap-2">
                      {project.technologies.map((tech, techIndex) => (
                        <span
                          key={techIndex}
                          className="px-3 py-1 text-xs bg-primary-100 dark:bg-primary-900 text-primary-700 dark:text-primary-300 rounded-full"
                        >
                          {tech}
                        </span>
                      ))}
                    </div>
                  </div>

                  {/* Features */}
                  <div>
                    <h4 className="font-semibold text-gray-900 dark:text-white mb-2">
                      Key Features:
                    </h4>
                    <ul className="space-y-1">
                      {project.features.slice(0, 3).map((feature, featureIndex) => (
                        <li key={featureIndex} className="text-sm text-gray-600 dark:text-gray-300 flex items-start gap-2">
                          <span className="text-primary-600 mt-1">â€¢</span>
                          <span>{feature}</span>
                        </li>
                      ))}
                    </ul>
                  </div>
                </div>
              </div>
            </motion.div>
          ))}
        </motion.div>
      </div>
    </section>
  );
};

export default Projects;
